INSERT INTO course_embeddings (content, metadata, embedding_vector) VALUES ('Course: UI/UX Designer Fellowship - Curriculum
Week 1: Topics: Business Thinking in Design, Systems Thinking, KPI Trees, Business Models. Outcomes: Understand business impact on design, Map outcomes.
Week 2: Topics: Product Discovery & User Research, Impact Mapping, User Segmentation, Opportunity Sizing, User Research Methodologies, Jobs to be Done, Journey Mapping, User Personas, Affinity Mapping. Outcomes: User segmentation, Journey mapping, Using AI for user research.
