INSERT INTO course_embeddings (content, metadata, embedding_vector) VALUES ('Course: Business Analyst Fellowship - Curriculum
Week 1: Topics: Business Thinking, Systems Thinking, Understanding Business Models, Building KPI Trees, OKRs. Outcomes: KPI Trees, Business Models.
