INSERT INTO course_embeddings (content, metadata, embedding_vector) VALUES ('Course: Data Analyst Fellowship - Curriculum
Week 1: Topics: Introduction to Data Analytics, Types of Data, Metrics & Analysis Types, EDA Steps, Intro to Data Viz. Outcomes: Exploratory data analysis steps, Metrics.
Week 2: Topics: Data Preparation using Excel, Basic Functions, Formatting, Cleaning, Error Validation. Outcomes: Cleaning, Formatting, Validation.
Week 3: Topics: Data Analysis using Excel, PivotTables, Scenario Analysis, Lookups, Merging. Outcomes: Pivot tables, Scenario analysis.
