INSERT INTO course_embeddings (content, metadata, embedding_vector) VALUES ('Course: Applied Generative AI Bootcamp - Curriculum
Week 1: Topics: Introduction to LLMs, Transformers Architecture, Neural Networks Basics. Outcomes: Understanding Transformers, LLM Basics.
Week 2: Topics: Prompt Engineering, Advanced Prompting Techniques, Few-shot Learning, Chain of Thought. Outcomes: Advanced prompting, Few-shot learning.
Week 3: Topics: Building with APIs, OpenAI API, HuggingFace API, LangChain Basics. Outcomes: OpenAI API, HuggingFace.
Week 4: Topics: RAG Architecture, Vector Databases, Embeddings, Semantic Search. Outcomes: Vector Databases, Embeddings.
Week 5: Topics: Building AI Agents, Agent Frameworks, Tool Use. Outcomes: Building Agents.
